// ReviewsListPage.tsx
import React from 'react';
import Review from './Review';
import './ReviewsListPage.css';

const ReviewsListPage: React.FC = () => {
  const reviews = [
    { id: 1, name: 'John Doe', description: 'Great experience!', photo: 'https://example.com/photo1.jpg' },
    { id: 2, name: 'Jane Smith', description: 'Awesome service!', photo: 'https://example.com/photo2.jpg' },
    // Add more reviews as needed
  ];

  return (
    <div className="reviews-list-container">
      <h1>Reviews List</h1>
      <div className="reviews-list">
        {reviews.map((review) => (
          <Review
            key={review.id}
            name={review.name}
            description={review.description}
            photo={review.photo}
          />
        ))}
      </div>
    </div>
  );
};

export default ReviewsListPage;
